description:
Chính chủ nhờ Bán Nhà Ngõ Phố Nguyễn Thị Định (Thông với Ngõ 124 Phố Hoàng Ngân) Trung Hòa, Cầu Giấy, Hà Nội.
-Diện tích sổ đỏ: 62m2 x 5 tầng, mặt tiền rộng: 4,2m; Nhà có Gara ô tô;
- Hướng: Đông Bắc;
- Vị trí: Đường trước nhà rộng 10,5m, có vỉa hè rộng 3m; Vị trí kinh doanh sầm uất;
- Giá bán: 16,5 tỷ (Có thương lượng nhiều)
